          <button>edit</button>
        </div>
        <input
          type="text"
          name="ddd"
          id=""
          value={this.props.data.first_name}
          disabled
        />
        <h1>Name : {this.props.data.first_name}</h1>
        <h1>Email : {this.props.data.email}</h1>
        <h1>Last name : {this.props.data.last_name}</h1>
      </div>
    );
  }
}
